import  YogaInsert from './pages/YogaInsert'
import YogaUpdate from "./pages/YogaUpdate"

function App() {
  return (
    <div>
    <header>
      Yoga Class Admission From
    </header>
      <YogaForm/>
      {/* <Router> */}
                <Route path="/movies/create" exact component={YogaInsert} />
                <Route
                    path="/yoga/update/:id"
                    exact
                    component={YogaUpdate}
                />
        {/* </Router> */}
    </div>
  );
}

export default App;
